<!-- Cookie Consent -->
<script defer>
document.addEventListener('DOMContentLoaded', function(event) {
    if (!Cookies.get('cookie-consent')) {
        showCookieConsent();
    }
});

function showCookieConsent() {
    const cookieBar = document.createElement('div');
    cookieBar.className = 'cookie-consent-bar';
    cookieBar.innerHTML = `
        <div class="cookie-content">
            <p>${cookieConfig.message || 'Website ny s dng cookie  m bo bn c c tri nghim tt nht trn website ca chng ti.'}</p>
            <div class="cookie-buttons">
                <button onclick="acceptCookies()" class="accept-button">
                    ${cookieConfig.acceptButton || 'ng '}
                </button>
                <a href="${cookieConfig.policyUrl || '/chinh-sach-cookie'}" class="learn-more">
                    ${cookieConfig.learnMore || 'Tm hiu thm'}
                </a>
            </div>
        </div>
    `;
    document.body.appendChild(cookieBar);
}

function acceptCookies() {
    Cookies.set('cookie-consent', 'accepted', { expires: 365 });
    const cookieBar = document.querySelector('.cookie-consent-bar');
    if (cookieBar) {
        cookieBar.remove();
    }
}

const cookieConfig = {
    message: "{{ $config->cookie_message ?? 'Website ny s dng cookie  m bo bn c c tri nghim tt nht trn website ca chng ti.' }}",
    acceptButton: "{{ $config->cookie_accept_text ?? 'ng ' }}",
    learnMore: "{{ $config->cookie_learn_more_text ?? 'Tm hiu thm' }}",
    policyUrl: "{{ $config->cookie_policy_url ?? '/chinh-sach-cookie' }}"
};
</script>

<style>
.cookie-consent-bar {
    position: fixed;
    bottom: 0;
    left: 0;
    right: 0;
    background: rgba(0, 0, 0, 0.9);
    color: #fff;
    padding: 1rem;
    z-index: 9999;
}

.cookie-content {
    max-width: 1200px;
    margin: 0 auto;
    display: flex;
    align-items: center;
    justify-content: space-between;
    flex-wrap: wrap;
    gap: 1rem;
}

.cookie-buttons {
    display: flex;
    gap: 1rem;
    align-items: center;
}

.accept-button {
    background: #4CAF50;
    color: white;
    border: none;
    padding: 0.5rem 1rem;
    border-radius: 4px;
    cursor: pointer;
}

.learn-more {
    color: #fff;
    text-decoration: underline;
}

@media (max-width: 768px) {
    .cookie-content {
        flex-direction: column;
        text-align: center;
    }
}
</style>

